import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Modal, Button } from 'react-bootstrap'; // 假设使用 react-bootstrap 的 Modal 和 Button

function PracticeEndModal({ show, onHide, questionCount }) {
  const navigate = useNavigate();

  return (
    <Modal show={show} onHide={onHide}>
      <Modal.Header closeButton>
        <Modal.Title>👏🏻👏🏻恭喜完成练习!</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <p>太棒啦！你练习了 {questionCount} 道题目！</p>
        <p> 每一次的模拟，都是你们征服梦想的小小演练。🛡️ 每个自信的回答，每个深思的瞬间，都在为你铺设通往理想学府的彩虹桥。🌈 记得，每一步的坚持都超级重要！继续前进吧，你的未来一定充满无限可能！🚀📖💫💪🎊</p>
        <Button variant="primary" onClick={() => navigate('/')}>
          回到首页
        </Button>
        {' '}
        <Button variant="secondary" onClick={() => navigate('/history')}>
          查看历史记录
        </Button>
      </Modal.Body>
    </Modal>
  );
}

export default PracticeEndModal;
